import React, {Component} from "react";
import Alert from "bootstrap/js/src/alert";


class Feedback extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="alert alert-danger alert- mt-2">
                <p><strong>Oh snap!</strong> {this.props.feedback_text}</p>
            </div>
        );
    }
}

export default Feedback;
